import './styles.scss';

const Sidebar = () => {
  return (
    <div className="sidebar-wrapper">
      <h6 className="sidebar-title">categories</h6>
      <ul>
        <li>
          <img src="../assets/images/document-icon.png" alt="icon" />
        </li>
        <li>
          <img src="../../assets/images/dashboard-icon.svg" alt="icon" />
        </li>
        <li>
          <img src="../../assets/images/dashboard-icon.svg" alt="icon" />
        </li>
      </ul>
    </div>
  );
};

export default Sidebar;
